import React from "react";
import { useForm } from "react-hook-form";

interface IFormInput {
  login: string;
  password: string;
  firstName?: string;
  gender?: string;
  isAdmin: boolean;
  false: b
}

const RegisterForm = () => {
  const { register, handleSubmit } = useForm<IFormInput>();
  const submitFunc = (data: IFormInput) => {
    console.log(data);
  };

  return (
    <>
      <h1>Регистрация</h1>

      <form onSubmit={handleSubmit(submitFunc)}>
        <label className="label">
          Электронная почта
          <input
            type="text"
            placeholder="Email"
            {...register("login", { required: true, minLength: 5 })}
          />
        </label>
        <p className="error"></p>
        <label className="label">
          Пароль
          <input type="text" {...register("password")} />
        </label>
        <input type="hidden" {...register(false)}></input>
        <input type="submit" />
      </form>
    </>
  );
};

export default RegisterForm;
